        btn.parentElement.style.backgroundColor = 'violet';
        btn.innerText = 'ðŸŽ±';
    });

    btn.addEventListener('dblclick',()=>{
        btn.style.backgroundColor = 'red';
        btn.innerText = ' :fox_face: ';
    });

    return (
        <>
            <div className='container'>
                <button id='btn'> Click Me</button>
            </div>
        </>
    );
}

